# Puzzle Input
key = '''



'''

# Bathroom Pad Dial
pad = ["  1  ",
       " 234 ",
       "56789",
       " ABC ",
       "  D  "]

# Variable to contain bathroom Code
lineCode = ""
masterCode = ""

# Starting Button is 5
yIndex, xIndex = 2, 0

for line in key.split("\n"):
    for direction in line:

        # yIndex: Up & Down
        if direction == "U":
            if yIndex - 1 >= 0 and pad[yIndex - 1][xIndex] != " ":
                yIndex -= 1
        elif direction == "D":
            if yIndex + 1 <= 4 and pad[yIndex + 1][xIndex] != " " :
                yIndex += 1

        # xIndex: Left & Right
        elif direction == "L":
            if xIndex - 1 >= 0 and pad[yIndex][xIndex - 1] != " ":
                xIndex -= 1
        elif direction == "R":
            if xIndex + 1 <= 4 and pad[yIndex][xIndex + 1] != " ":
                xIndex += 1

        lineCode += pad[yIndex][xIndex]
    masterCode += lineCode[-1]
print(masterCode)